import React from 'react';
import { useLocation } from 'react-router-dom';
import { AiOutlineMail } from 'react-icons/ai';
import { CgWebsite } from 'react-icons/cg';
import { BsTelephone } from 'react-icons/bs';
import './Resume.css';

const Resume = () => {
    const location = useLocation();
    const { userObject } = location.state || {};

    return (
        <div className='resume-container'>
            <div className='header'>
                <h1>{userObject.firstName} {userObject.lastName}</h1>
                <div className='contact'>
                    <p><AiOutlineMail className='icon' /> {userObject.email}</p>
                    <p><BsTelephone className='icon' /> {userObject.phone}</p>
                    {userObject.website && <p><CgWebsite className='icon' /> {userObject.website}</p>}
                    {userObject.location && <p>{userObject.location}</p>}
                </div>
            </div>

            <div className='section'>
                <h2>WORK EXPERIENCE</h2>
                {userObject.experience && userObject.experience.map((exp, index) => (
                    <div key={index} className='experience-item'>
                        <h3>{exp.title} <span>{exp.dates}</span></h3>
                        <p className='company'>{exp.company}, {exp.location}</p>
                        <ul className='description'>
                            {exp.description.map((desc, idx) => <li key={idx}>{desc}</li>)}
                        </ul>
                    </div>
                ))}
            </div>

            <div className='section'>
                <h2>EDUCATION</h2>
                <div className='education-item'>
                    <p>{userObject.uni}</p>
                    <p>{userObject.degree}, {userObject.gradYear}</p>
                    <p>GPA: {userObject.gpa}</p>
                </div>
            </div>

            <div className='section'>
                <h2>SKILLS</h2>
                <p>{userObject.skills}</p>
            </div>

            <div className='section'>
                <h2>CERTIFICATIONS</h2>
                <p>{userObject.certs}</p>
            </div>
        </div>
    );
};

export default Resume;
